  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, chemical, biological, meteorological,
  and other data were collected from bottle casts, CTD casts, and divers from FIXED
  PLATFORMS. Data were collected by Western Washington University (WWU) from 06 February
  1989 to 12 March 1998. Physical parameters include water temperature, pH, dissolved
  oxygen, turbidity, and salinity. Nutrients parameters include concentrations of
  ammonia, nitrate, phosphate, phaeopigment, and C02. Meteorological parameters include
  wind speed, rainfall, and cloud cover. Skin diver data include sighting of juvenile
  rockfish, collection of sea cucumbers, and collection of green urchins.\",\n\t\"owner_org\":
